import React, {useState} from 'react'

export default function Login () {

    const [username, setUsername] = useState('')
    const [password, setPassword] = useState('')

    function insertUsername(e){
        setUsername(e.target.value)
    }
    function inserPassword (e) {
        setPassword(e.target.value)
    } 

    function submitLogin (e) {
        e.preventDefault
        console.log(username, password)
    }

    return (

        <form>
            <div class="mb-3">
                <label for="username" class="form-label">Username</label>
                <input onChange={insertUsername} type="email" class="form-control" id="username" aria-describedby="emailHelp"/>
            </div>
            <div class="mb-3">
                <label for="password" class="form-label">Password</label>
                <input onChange={inserPassword} type="password" class="form-control" id="password"/>
            </div>
            <button onClick={submitLogin} type="submit" class="btn btn-primary">Submit</button>
        </form>
    )
}
